import React from "react";
import CardTitle from "../CardTitle";
import "./style.css";

function CardHeading({ lastname, firstname }) {
  return ( 
    <div>
      <CardTitle lastname={lastname} firstname={firstname}/>
    </div> 
  );
}

export default CardHeading;
